import React, { Component } from 'react';

import { Link } from 'react-router-dom';
import { Row, Col, Tabs, Table, Divider, Tag, message, Card, Drawer, Menu, Dropdown, Button, Layout, Carousel, Input, Pagination, Popover, Icon, Cascader,Tooltip, Switch,Modal,Form, AutoComplete, Select, Checkbox, Radio } from 'antd';

import firebase from 'firebase';
import * as firebaseui from 'firebaseui';
import { fire, facebookProvider } from '../../fire';



import paddleboard from './images/paddleboard.jpg';
import faucet from './images/faucet.jpg';
import kayak from './images/kayak.jpg';
import lakeSign from './images/lakeSign.jpg';
import floatingScreen from './images/floatingScreen.png';
import macbook from './images/macbook.png';

import 'antd/dist/antd.css';


const { Option } = Select;
const AutoCompleteOption = AutoComplete.Option;

function hasErrors(fieldsError) {
  return Object.keys(fieldsError).some(field => fieldsError[field]);
}

function handleClick(e) {
  console.log('click', e);
}

class RegistrationForm extends React.Component {
  state = {
    confirmDirty: false,
    autoCompleteResult: [],
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    formDisplay: 'none',
    formDisplay1: null,
  };

  handleSubmit = (e) => {
    e.preventDefault();

      const projectsListRef = fire.database().ref(`leads`);
        this.props.form.validateFieldsAndScroll((err, values) => {
          if (!err) {
            console.log('Received values of form: ', values);
            this.setState({
              firstName: values.firstName,
              lastName: values.lastName,
              email: values.email,
              company: values.company,
              phone: values.phone,
              formDisplay: null,
              formDisplay1: 'none',
            })

            const projectInfo = {
              firstName: values.firstName,
              lastName: values.lastName,
              email: values.email,
              company: values.company,
              phone: values.phone,
            }
            projectsListRef.push(projectInfo);
          }

        });




  }

  handleConfirmBlur = (e) => {
    const value = e.target.value;
    this.setState({ confirmDirty: this.state.confirmDirty || !!value });
  }

  compareToFirstPassword = (rule, value, callback) => {
    const form = this.props.form;
    if (value && value !== form.getFieldValue('password')) {
      callback('Two passwords that you enter is inconsistent!');
    } else {
      callback();
    }
  }

  validateToNextPassword = (rule, value, callback) => {
    const form = this.props.form;
    if (value && this.state.confirmDirty) {
      form.validateFields(['confirm'], { force: true });
    }
    callback();
  }



  render() {
    const { getFieldDecorator } = this.props.form;
    const { autoCompleteResult } = this.state;

    const testLayout = {
      labelCol: {
        xs: { span: 24 },
        sm: { span: 8 },
      },
      wrapperCol: {
        xs: { span: 24 },
        sm: { span: 16 },
      },
    };
    const tailFormItemLayout = {
      wrapperCol: {
        xs: {
          span: 24,
          offset: 0,
        },
        sm: {
          span: 16,
          offset: 8,
        },
      },
    };


    const websiteOptions = autoCompleteResult.map(website => (
      <AutoCompleteOption key={website}>{website}</AutoCompleteOption>
    ));

    return (
      <div>
      <Form  onSubmit={this.handleSubmit} style={{display: this.state.formDisplay1, fontSize: 12}}>

        <p style={{fontSize: 16}}><b>Access Demo</b></p>


        <Form.Item {...testLayout}
          label="First Name"
        >
          {getFieldDecorator('firstName', {
            rules: [{ required: true, message: 'Please input your first name!', whitespace: true }],
          })(
            <Input />
          )}
        </Form.Item>

        <Form.Item {...testLayout}
          label="Last Name"
        >
          {getFieldDecorator('lastName', {
            rules: [{ required: true, message: 'Please input your last name!', whitespace: true }],
          })(
            <Input />
          )}
        </Form.Item>
        <Form.Item {...testLayout}
          label="E-mail"
        >
          {getFieldDecorator('email', {
            rules: [{
              type: 'email', message: 'The input is not valid E-mail!',
            }, {
              required: true, message: 'Please input your E-mail!',
            }],
          })(
            <Input />
          )}
        </Form.Item>
        <Form.Item {...testLayout}
          label="Company"
        >
          {getFieldDecorator('company', {
            rules: [{ required: true, message: 'Please input your company!', whitespace: true }],
          })(
            <Input />
          )}
        </Form.Item>

        <Form.Item {...testLayout}
          label="Phone"
        >
          {getFieldDecorator('phone', {
            rules: [{ required: true, message: 'Please input your phone number!' }],
          })(
            <Input style={{ width: '100%' }} />
          )}
        </Form.Item>



        <Form.Item {...testLayout} style={{textAlign: 'right'}}>
          <Button type="primary" htmlType="submit">Access Demo</Button>
        </Form.Item>

        <p>{this.state.firstName} {this.state.lastName}</p>
      </Form>



      <Card style={{textAlign: 'center', display: this.state.formDisplay}} bordered={false}>
      <Row >
      <Col span={24}>
      <p style={{fontSize: 28}}><b>Please use the following information to login to your demo:</b></p>
      </Col>
      </Row>

      <Row >
      <Col span={24}>
      <p style={{fontSize: 18}}><b>Email: </b>Lake@AquaSource.com</p>
      </Col>
      </Row>
      <Row >
      <Col span={24}>
      <p style={{fontSize: 18}}><b>Password: </b>LakeLake</p>
      </Col>
      </Row>

      <Icon style={{fontSize: 32}} type="check-circle" theme="twoTone" />

      <Row>
      <Col span={24}>

      </Col>

      </Row>

      </Card>
      </div>
    );
  }
}

const WrappedRegistrationForm = Form.create({ name: 'register' })(RegistrationForm);


export default class demo extends Component {
  constructor(props, context) {
    super(props, context);

    this.state = {
      visibleModal: false,
      visibleMobile: false,
      visibleMobile1: false,
      visibleQuote: false,
      visibleQuoteMobile: false,
      mobileLogin: false,


    };

  }

  showMobileDrawer = () => {
    this.setState({
      visibleMobile: true,
    });
  };

  onCloseMobile = () => {
   this.setState({
     visibleMobile: false,
   });
  };

  showMobileDrawer1 = () => {
    this.setState({
      visibleMobile1: true,
    });
  };

  onCloseMobile1 = () => {
   this.setState({
     visibleMobile1: false,
   });
  };

  showQuoteDrawer = () => {
   this.setState({
     visibleQuote: true,
   });
  };

  showQuoteDrawerMobile = () => {
   this.setState({
     visibleQuoteMobile: true,
   });
  };

  onQuoteMobile = () => {
  this.setState({
    visibleQuote: false,
    visibleQuoteMobile: false,
  });
  };


  showDrawerMobileLogin = () => {
    this.setState({
      mobileLogin: true,
    });
  };

  closeDrawerMobileLogin = () => {
    this.setState({
      mobileLogin: false,
    });
  };

  render() {



    function onChange(a, b, c) {
      console.log(a, b, c);
    }

    return (
      <Layout style={{backgroundColor: 'white'}}>

        <Drawer
        title={<Row>
        <Col span={3}>

        </Col>

        <Col span={10}>
          <p style={{fontSize: 32, paddingTop: 15}}><b>Aqua</b>Source</p>
        </Col>
        <Col span={8} style={{textAlign: 'right', paddingTop: 15}}>
        <Button onClick={this.onQuoteMobile} type="primary">Close</Button>
        </Col>
        </Row>

        }
        placement="top"
        closable={false}
        onClose={this.onQuoteMobile}
        visible={this.state.visibleQuote}
        height={750}

        >
        <Row>
        <Col span={3}>

        </Col>

        <Col span={10}>

